  function calcDxTx(elementID, solo)
  {
    
    // set solo default
    if (solo === undefined) 
    {
      solo = false;
    }

    // get entered values
    var dxtx_1 = parseInt($('#dxtx_1').val());
    var dxtx_2 = parseInt($('#dxtx_2').val());
    var dxtx_3 = parseInt($('#dxtx_3').val());
    var dxtx_4 = parseInt($('#dxtx_4').val());
    var dxtx_5 = parseInt($('#dxtx_5').val());
    
    //validate min/max
    var dxtx_1_real = validateMinMax(dxtx_1, 0, 2);
    var dxtx_2_real = validateMinMax(dxtx_2, 0, 5);
    var dxtx_3_real = validateMinMax(dxtx_3, 0, 5);
    var dxtx_4_real = validateMinMax(dxtx_4, 0, 1);
    var dxtx_5_real = validateMinMax(dxtx_5, 0, 5);
    if (dxtx_1 != dxtx_1_real) { $('#dxtx_1').val(dxtx_1_real); dxtx_1 = dxtx_1_real; }
    if (dxtx_2 != dxtx_2_real) { $('#dxtx_2').val(dxtx_2_real); dxtx_2 = dxtx_2_real; }
    if (dxtx_3 != dxtx_3_real) { $('#dxtx_3').val(dxtx_3_real); dxtx_3 = dxtx_3_real; }
    if (dxtx_4 != dxtx_4_real) { $('#dxtx_4').val(dxtx_4_real); dxtx_4 = dxtx_4_real; }
    if (dxtx_5 != dxtx_5_real) { $('#dxtx_5').val(dxtx_5_real); dxtx_5 = dxtx_5_real; }
    
    dxtxScore = 0;  // declared outside of this function - don't "var" it here or it won't keep it's value outside of the function
    var dxtxCalc = 0;
    var dxtxResult = '';
    
    // calculate
    $('#dxdx_1_result').html(dxtx_1*1);
    dxtxCalc = dxtx_1*1;
    $('#dxdx_2_result').html(dxtx_2*1);
    dxtxCalc = dxtxCalc+dxtx_2*1;
    $('#dxdx_3_result').html(dxtx_3*2);
    dxtxCalc = dxtxCalc+dxtx_3*2;
    $('#dxdx_4_result').html(dxtx_4*3);
    dxtxCalc = dxtxCalc+dxtx_4*3;
    $('#dxdx_5_result').html(dxtx_5*4);
    dxtxCalc = dxtxCalc+dxtx_5*4;
    
    // determine type
    switch (dxtxCalc)
    {
      case 0: 
        dxtxResult = 'N/A';
        break;
      case 1: 
        dxtxResult = 'Minimal';
        dxtxScore = 1;
        break;
      case 2: 
        dxtxResult = 'Limited'; 
        dxtxScore = 2;
        break;
      case 3: 
        dxtxResult = 'Multiple'; 
        dxtxScore = 3;
        break;
      default: // 4 or higher
        dxtxResult = 'Extensive'; 
        dxtxScore = 4;
        break;
    }

    // write final result
    $('#dxtxResult').html(dxtxResult);
    $('#dxtxCalc').html(dxtxCalc);

    // if this function is not being called solo, pass on the work
    if (!solo)
    {
      // update the MDM grid
      calcMDM();
    }
    
  }  // end function calcDxTx


