  function calcOverall(solo)
  {
    
    // set solo default
    if (solo === undefined) 
    {
      solo = false;
    }

    // get encounterType
    var encounterType = $('#encounter_type').val();

    // clear highlights
    $('#overall_grid_'+encounterType+'>tbody>tr>td').removeClass('overall-highlight');
    $('#overall_grid_'+encounterType+'>tbody>tr>th').removeClass('overall-highlight');

    // set overallCalc if all of the score are present, and set calc values for the three components
    var validCode = $('#valid_code').val();
    var validCode2 = $('#valid_code2').val();
    if (validCode == 'no' || validCode2 == 'no')
    {
      validCode = 'no';
    }
    var overallCalc = (historyScore>0 && examScore>0 && mdmScore>0);
    var historyScoreCalc = historyScore;
    var examScoreCalc = examScore;
    var mdmScoreCalc = mdmScore;
    var componentCode = 'N/A';
    var componentStatus = '';
    var componentOverUnder = '';
    var componentLevel = '';
    var componentResultsText = '';
    var componentResults = '';
    
    // set overall based on encounter type
    switch (encounterType)
    {
      case 'office_new':
        if (historyScoreCalc>0)
        {
          if (historyScoreCalc==4) historyScoreCalc = 5;
          $('#'+encounterType+'_history_'+historyScoreCalc ).addClass('overall-highlight');
        }
        if (examScoreCalc>0)
        {
          if (examScoreCalc==4) examScoreCalc = 5;
          $('#'+encounterType+'_exam_'+examScoreCalc ).addClass('overall-highlight');
        }
        if (mdmScoreCalc>0)
        {
          mdmScoreCalc++;
          $('#'+encounterType+'_mdm_'+mdmScoreCalc ).addClass('overall-highlight');
        }
        if (overallCalc)  // take the lowest score
        {
          min = Math.min(historyScoreCalc, examScoreCalc, mdmScoreCalc);
          $('#'+encounterType+'_overall_'+min ).addClass('overall-highlight');
          switch (min)
          {
            case 1: componentCode = '99201'; break;
            case 2: componentCode = '99202'; break;
            case 3: componentCode = '99203'; break;
            case 4: componentCode = '99204'; break;
            case 5: componentCode = '99205'; break;
          }
          componentLevel = min;
        }
        break;
      case 'office_est':
        if (historyScoreCalc>0)
        {
          $('#'+encounterType+'_history_'+historyScoreCalc ).addClass('overall-highlight');
        }
        if (examScoreCalc>0)
        {
          $('#'+encounterType+'_exam_'+examScoreCalc ).addClass('overall-highlight');
        }
        if (mdmScoreCalc>0)
        {
          $('#'+encounterType+'_mdm_'+mdmScoreCalc ).addClass('overall-highlight');
        }
        if (overallCalc)  // take the middle score
        {
          var vals = [historyScoreCalc, examScoreCalc, mdmScoreCalc];
          vals.sort();
          $('#'+encounterType+'_overall_'+vals[1] ).addClass('overall-highlight');
          switch (vals[1])
          {
            case 1: componentCode = '99212'; break;
            case 2: componentCode = '99213'; break;
            case 3: componentCode = '99214'; break;
            case 4: componentCode = '99215'; break;
          }
          componentLevel = vals[1];
        }
        break;
      case 'hospital_new':
        if (historyScoreCalc>2)
        {
          if (historyScoreCalc==4) 
          {
            historyScoreCalc = 3;
          } else if (historyScoreCalc==3)
          {
            historyScoreCalc = 1;
          }
          $('#'+encounterType+'_history_'+historyScoreCalc ).addClass('overall-highlight');
        }
        if (examScoreCalc>2)
        {
          if (examScoreCalc==4) 
          {
            examScoreCalc = 3;
          } else if (examScoreCalc==3)
          {
            examScoreCalc = 1;
          }
          $('#'+encounterType+'_exam_'+examScoreCalc ).addClass('overall-highlight');
        }
        if (mdmScoreCalc>0)
        {
          if (mdmScoreCalc>1) mdmScoreCalc--;
          $('#'+encounterType+'_mdm_'+mdmScoreCalc ).addClass('overall-highlight');
        }
        if (overallCalc)  // take the lowest score
        {
          min = Math.min(historyScoreCalc, examScoreCalc, mdmScoreCalc);
          $('#'+encounterType+'_overall_'+min ).addClass('overall-highlight');
          switch (min)
          {
            case 1: componentCode = '99221'; break;
            case 2: componentCode = '99222'; break;
            case 3: componentCode = '99223'; break;
          }
          componentLevel = min;
        }
        break;
      case 'hospital_sub':
        if (historyScoreCalc>0)
        {
          if (historyScoreCalc==4) historyScoreCalc = 3;
          $('#'+encounterType+'_history_'+historyScoreCalc ).addClass('overall-highlight');
        }
        if (examScoreCalc>0)
        {
          if (examScoreCalc==4) examScoreCalc = 3;
          $('#'+encounterType+'_exam_'+examScoreCalc ).addClass('overall-highlight');
        }
        if (mdmScoreCalc>0)
        {
          if (mdmScoreCalc>1) mdmScoreCalc--;
          $('#'+encounterType+'_mdm_'+mdmScoreCalc ).addClass('overall-highlight');
        }
        if (overallCalc)  // take the middle score
        {
          var vals = [historyScoreCalc, examScoreCalc, mdmScoreCalc];
          vals.sort();
          $('#'+encounterType+'_overall_'+vals[1] ).addClass('overall-highlight');
          switch (vals[1])
          {
            case 1: componentCode = '99231'; break;
            case 2: componentCode = '99232'; break;
            case 3: componentCode = '99233'; break;
          }
          componentLevel = vals[1];
        }
        break;
      case 'consult':
        if (historyScoreCalc>0)
        {
          if (historyScoreCalc==4) historyScoreCalc = 5;
          $('#'+encounterType+'_history_'+historyScoreCalc ).addClass('overall-highlight');
        }
        if (examScoreCalc>0)
        {
          if (examScoreCalc==4) examScoreCalc = 5;
          $('#'+encounterType+'_exam_'+examScoreCalc ).addClass('overall-highlight');
        }
        if (mdmScoreCalc>0)
        {
          mdmScoreCalc++;
          $('#'+encounterType+'_mdm_'+mdmScoreCalc ).addClass('overall-highlight');
        }
        if (overallCalc)
        {
          min = Math.min(historyScoreCalc, examScoreCalc, mdmScoreCalc);
          $('#'+encounterType+'_overall_'+min ).addClass('overall-highlight');
          switch (min)
          {
            case 1: componentCode = '99241'; break;
            case 2: componentCode = '99242'; break;
            case 3: componentCode = '99243'; break;
            case 4: componentCode = '99244'; break;
            case 5: componentCode = '99245'; break;
          }
          componentLevel = min;
        }
        break;
    }
    
    // check against em_code_reported to see if it was under, over or correct (or incorrect for the type of encounter selected)
    if (componentCode != 'N/A')
    {
      componentResults = componentCode;
      componentResultsText = 'Method: Component | Calculated: '+componentCode;
    }
    var emCodeReported = $('#em_code_reported').val();
    if (emCodeReported && validCode == 'yes' && componentCode != 'N/A')
    {
      componentResultsText += ' | Reported: '+emCodeReported;
      var codeInt = parseInt(emCodeReported);
      var codeCalculated = parseInt(componentCode);
      var backgroudColor = '';
      var textColor = '';
      var codeStatus = '';
      if (codeInt > codeCalculated)
      {
        backgroundColor = 'red';
        textColor = 'white';
        codeStatus = 'is overcoded.';
        componentOverUnder = 'overcoded';
        componentResults += ' [overcoded as '+emCodeReported+']';
        componentResultsText += ' [overcoded]';        
      } else if (codeInt == codeCalculated)
      {
        backgroundColor = 'green';
        textColor = 'white';
        codeStatus = 'is coded correctly.';
        componentResults += ' (correct)';
      } else
      {
        backgroundColor = 'yellow';
        textColor = 'black';
        codeStatus = 'is undercoded.';
        componentOverUnder = 'undercoded';
        componentResults += ' [undercoded as '+emCodeReported+']';
        componentResultsText += ' [undercoded]';
      }
      componentStatus = 'Reported code '+emCodeReported+' '+codeStatus;
      $('#em_code_over_under2').html('&nbsp;'+componentStatus+'&nbsp;')
        .css('background-color', backgroundColor)
        .css('color', textColor)
        .show();
    } else if (emCodeReported)
    {
      $('#em_code_over_under2').hide();
      backgroundColor = 'red';
      textColor = 'white';
      codeStatus = 'Reported Code is INCORRECT.';
      componentOverUnder = 'incorrect reported code';
      componentResults += ' [incorrectly coded as '+emCodeReported+']';
      componentResultsText += '';        
    } else
    {
      $('#em_code_over_under2').hide();
    }
    $('#component_code_display').html(componentCode);
    $('#component_code').val(componentCode);
    $('#component_status').val(componentStatus);

    // save values
    $('#hpi_score').val(hpi);
    $('#ros_score').val(ros);
    $('#pfsh_score').val(pfsh);
    $('#history_score').val(historyScore);
    $('#exam_score').val(examScore);
    $('#dxtx_score').val(dxtxScore);
    $('#data_review_score').val(dataReviewScore);
    $('#risk_score').val(riskScore);
    $('#mdm_score').val(mdmScore);
    $('#component_level').val(componentLevel);
    $('#component_over_under').val(componentOverUnder);
    $('#component_results').val(componentResults);
    $('#component_results_text').val(componentResultsText);
    
    // if this function is not being called solo, pass on the work
    if (!solo)
    {
      // update overall result
      updateOverallResult();
    }
    
  }  // end function calcOverall

  
  function updateOverallResult()  // no "solo" parameter on this one
  {
    
    // update overall result
    var timeCode = $('#time_code').val();
    var timeOverUnder = $('#time_over_under').val();
    var timeResults = $('#time_results').val();
    var timeResultsText = $('#time_results_text').val();
    var componentCode = $('#component_code').val();
    var componentOverUnder = $('#component_over_under').val();
    var componentResults = $('#component_results').val();
    var componentResultsText = $('#component_results_text').val();
    var overrideCode = $('#override_code').val();
    var emCodeReported = $('#em_code_reported').val();
    var results = '';
    var resultsText = '';
    var emResult = '';

    // initialize override values
    $('#override_over_under').val('');
    $('#override_results_text').val('');
    $('#override_results').val(overrideCode);

    // determine which calculation to use
    var useResult = '';
    if ($('#use_time_result').is(':checked')) 
    {
      useResult = 'time';
    }
    if ($('#use_component_result').is(':checked')) 
    {
      useResult = 'component';
    }
    if ($('#use_override_result').is(':checked')) 
    {
      useResult = 'override';
    }

    // build the results text
    if (timeResults)
    {
      if (!useResult)
      {
        useResult = 'time';
      }
      resultsText = timeResultsText;
      $('#use_time_result').prop('disabled', false);
      $('#time_results_text_display').html(timeResults);
    } else
    {
      $('#use_time_result').prop('disabled', true);
      $('#time_results_text_display').html('N/A');
    }
    if (componentResults)
    {
      if (!useResult)
      {
        useResult = 'component';
      }
      if (resultsText) resultsText += "\n";
      resultsText = componentResultsText;
      $('#use_component_result').prop('disabled', false);
      $('#component_results_text_display').html(componentResults);
    } else
    {
      $('#use_component_result').prop('disabled', true);
      $('#component_results_text_display').html('N/A');
    }

    // if both are calculated figure out the higher value
    if (timeCode && componentCode && parseInt(timeCode)>parseInt(componentCode) && !useResult)
    {
      useResult = 'time';
      $("input[name=use_result][value=time]").prop('checked', true);
    }
    if (timeCode && componentCode && parseInt(timeCode)<=parseInt(componentCode) && !useResult)
    {
      useResult = 'component';
      $("input[name=use_result][value=component]").prop('checked', true);
    }

    // set final results
    switch (useResult)
    {
      case 'time':
        results = timeResults;
        emResult = timeOverUnder;
        break;
        
      case 'component':
        results = componentResults;
        emResult = componentOverUnder;
        break;
        
      case 'override':  // calculate and assign values
        var overrideOverUnder = '';
        var overrideResults = overrideCode;
        var overrideResultsText = 'Method: Assigned by Auditor | Code: '+overrideCode;
        if (emCodeReported)
        {
          componentResultsText += ' | Reported: '+emCodeReported;
        }
        if (validCode == 'no')
        {
          overrideResults += ' (INCORRECT)';
        } else if (parseInt(emCodeReported) > parseInt(overrideCode))
        {
          overrideOverUnder = 'overcoded';
          overrideResults += ' [overcoded as '+emCodeReported+']';
          overrideResultsText += ' [overcoded]';
        } else if (parseInt(emCodeReported) == parseInt(overrideCode))
        {
          overrideResults += ' (correct)';
        } else
        {
          overrideOverUnder = 'undercoded';
          overrideResults += ' [undercoded as '+emCodeReported+']';
          overrideResultsText += ' [undercoded]';
        }
        results = overrideResults;
        $('#override_results_text_display').html(overrideResults);
        emResult = overrideOverUnder;        
        $('#override_over_under').val(overrideOverUnder);
        $('#override_results_text').val(overrideResultsText);
        $('#override_results').val(overrideResults);
        if (resultsText) resultsText += "\n";
        resultsText = overrideResultsText;
        break;
    }

    // write values
    $('#results').val(results);
    $('#results_text').val(resultsText);
    $('#em_result').val(emResult);
    
  }  // end function updateOverallResult


  function gradeSOSExam(init=false) 
  {
	// get current selected SOS exam
	var selected_exam = $('#sel_sos').val();
	var exam_container = '#sos_' + selected_exam + '_container';
	$('.sos_container').hide();
	$(exam_container).show();
	
	
	// set grading defaults
	var sos_header = 'SOS';
	var bullet_score = 0;
	var level_1 = 0;
	var level_2 = 0;
	var level_3 = 0;
	var level_4 = 0;
	var sos_level = 0;
	var comprehensive_ok = true;
	
	
	switch (selected_exam)
    {
      case 'car':
		sos_header = 'Cardiovascular';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 27;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
      case 'ear':
	    sos_header = 'Ear, Nose and Throat';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 27;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	  case 'eye':
	    sos_header = 'Eye';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 9;
		level_4 = 14;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	  case 'gen':
	    sos_header = 'Genitourinary';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 36;
		
		var gender = $('#sos_gen_gender').val();
		var gender_count = 0;
		
		// calculate total bullets with only male or female
		var total_bullets = $(exam_container + " [type='checkbox']:checked").length; 
		var minus_malefemale = total_bullets - $(".esos_gen_genit:checked").length;
		
		if(gender == 'male')
		{
			level_4 = 25;
			$('#sos_gen_female').hide();
			$('#sos_gen_male').show();
			
			gender_count = $("#sos_gen_male [type='checkbox']:checked").length;
			bullet_score = minus_malefemale + gender_count;
		}
		else
		{
			level_4 = 23;
			$('#sos_gen_female').show();
			$('#sos_gen_male').hide();
			
			gender_count = $("#sos_gen_female [type='checkbox']:checked").length;
			
			if(gender_count < 7){ comprehensive_ok = false; }
			else{ comprehensive_ok = true; }
			
			bullet_score = minus_malefemale + gender_count;
		}
		
        break;
	  case 'hem':
	    sos_header = 'Hematologic/Lymphatic/Immunologic';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 21;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	  case 'mus':
	    sos_header = 'Musculoskeletal';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 40;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	  case 'neu':
	    sos_header = 'Neurological';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 25;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	  case 'psy':
	    sos_header = 'Psychiatric';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 9;
		level_4 = 15;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	  case 'res':
	    sos_header = 'Respiratory';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 24;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	  case 'ski':
	    sos_header = 'Skin';
        // set grading rules
		level_1 = 5;
		level_2 = 6;
		level_3 = 12;
		level_4 = 25;
		bullet_score = $(exam_container + " [type='checkbox']:checked").length; 
        break;
	}
	
	$('.sos_header').html(sos_header);
	
	$('#sos_result_1').html('1-' + level_1 + ' bulleted elements');
	$('#sos_result_2').html(level_2 + '-' + (level_3 - 1) + ' bulleted elements');
	$('#sos_result_3').html(level_3 + '-' + (level_4 - 1) + ' bulleted elements');
	// $('#sos_result_4').html('All bulleted elements');
	
	// Calculate sos exam level
	     if(bullet_score >= level_4 
	//	 && $('#sos_document_checkbox').is(":checked")
		 && comprehensive_ok)        { sos_level = 4 }
	else if(bullet_score >= level_3) { sos_level = 3 }
	else if(bullet_score >= level_2) { sos_level = 2 }
	else if(bullet_score <= level_1 && bullet_score > 0) { sos_level = 1 }
	else { sos_level = '0' }
	
	// Don't grade on initialize
	if(!init)
	{
		$("input[name=exam97sos]").val([sos_level]);
		$("#examCalcSOS").html(bullet_score);
	}
	
	calcExam();
	
  }
  
  function in_array(needle, haystack)
  {
    
    for(var i in haystack) 
    {
      if (haystack[i] == needle) return true;
    }
    return false;
    
  }
  
  
